import React from "react";
import { AppBar, Toolbar, Typography, Button } from '@material-ui/core';

function Book(props) {
  console.log("BOOK PROPS", props);
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6">
          News
        </Typography>
        <Button color="inherit">Login</Button>
      </Toolbar>
    </AppBar>
  );
}

export default Book;
